var title_f18_25_18843="Treatment of onchocerciasis";
var content_f18_25_18843=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F57427&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F57427&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Treatment of individuals with onchocerciasis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Individuals in endemic areas with high levels of ongoing transmission",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Ivermectin 150 mcg/kg orally (single dose); repeat every 3 to 6 months until asymptomatic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Individuals outside endemic areas or in areas with low transmission",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Doxycycline 200 mg orally once daily for 6 weeks, PLUS",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Ivermectin 150 mcg/kg orally (single dose) 4 to 6 months following end of doxycycline therapy",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    For individuals outside endemic areas or in areas with low transmission, doxycycline should be administered prior to ivermectin to deplete Wolbachia, thereby reducing inflammatory reactions induced by ivermectin.",
"    <br>",
"     Doxycycline is relatively contraindicated during pregnancy and in children &lt;9 years of age.",
"     <br>",
"      In community wide mass treatment programs in endemic areas, ivermectin is generally withheld from women known to be pregnant, small children &lt;15 kg and seriously ill persons.",
"      <div class=\"footnotes\">",
"      </div>",
"      <div class=\"reference\">",
"       Source: Hoerauf A. Filariasis: new drugs and new opportunities for lymphatic filariasis and onchocerciasis. Curr Opin Infect Dis 2008; 21:673.",
"      </div>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
